void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.xy;  
    vec2 u = uv;
    u *= 1.;
    float t = iTime * 3.3;
    float e = u.y - 0.3 ;
    e += sin(u.x * 7.0 - t ) * .1;
    float f = pow(u.x - 0.5,2.0)*3.0;
    e += sin(f*1.0+t*0.5)*0.1;
    e -= cos(u.x*17.241-t*1.22)*0.02;
    e*=2.5;
    float k = smoothstep(e,f,f*1.05); 
    float m = step(f,e);
    vec3 a = vec3(33.,33.9,1.1);
    vec3 b = vec3(1.0,0.2,0.3);
    vec3 c = mix(a,b,m / k);
    c.r *= uv.x / uv.y;
    fragColor = vec4(c,1.0);
}
